class Zip(object):

    @classmethod
    def forZip(cls, zip):
        if zip:
            try:
                index = int(zip)
            except ValueError:
                return None
                
            if (index > 0) and (index < len(ZIPS)):
                zipData = ZIPS[index]
                if zipData:
                    state = zipData[0:2]
                    city = zipData[2:]
                    return Zip(zip=zip, city=city, state=state)

    def __init__(self, zip, city, state):
        self.zip = zip
        self.city = city
        self.state = state

    def getState(self):
        from web.data.states import State
        return State.forAbbr(self.state)

    def getStateName(self):
        stateInfo = self.getState()
        if stateInfo: return stateInfo.name